import React from "react";
import { Col, Row } from "react-bootstrap";

const TodoItem = ({data}) => {
  return (
    <Row>
      <Col xs={12}>
        <div className={`todo-item`}>
          <div className="todo-content">{data.task}</div>

          <div>
            <button className="button-delete">삭제</button>
            <button className="button-delete" onClick={()=>changeTask(data._id)}>끝남</button>
          </div>
        </div>
      </Col>
    </Row>
  );
};

export default TodoItem;
